import React from "react";
import "./App.css";
import ListItem from "./SimpleComponents/ListItem";

function App() {
  const nameList = {
    name: {
      title: "mr",
      first: "brad",
      last: "gibson",
    },
    location: {
      city: "kilcoole",
    },
    email: "brad.gibson@example.com",
    dob: {
      date: "1993-07-20T09:44:18.674Z",
      age: 26,
    },
    picture: {
      medium: "https://randomuser.me/api/portraits/men/75.jpg",
    },
  };

  return (
    <React.Fragment>
      <h1 className="App">This is a List</h1>
      <p className="App">
        <ListItem
          name = {`${nameList.name.title} ${nameList.name.first} ${nameList.name.last}`}
          city = {nameList.location.city}
          email = {nameList.email}
          birthday = {new Intl.DateTimeFormat('en-GB').format(new Date(nameList.dob.date))}
          avatar = {nameList.picture.medium}
        />
      </p>
    </React.Fragment>
  );
}

export default App;
